  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130803 includes physical
  and profile data collected aboard the THOMAS JEFFERSON during project OPR-D304-TJ-09
  in the North Atlantic Ocean from 2009-04-07 to 2009-07-21. These data include SOUND
  VELOCITY. The instruments used to collect these data include CTD and sound velocimeter
  - moving vessel profiler. These data were collected and submitted by the NOAA Office
  of Coast Survey in support of hydrographic multibeam surveys to meet NOAA charting
  requirements.\",\n\t\"owner_org\": \"9cda5205-d632-4814-96e7-a4ab5e0dce85\",\n\t\"extras\":
